-- Changeset v4-22
PRINT 'Starting changeset 22';
GO

IF OBJECT_ID('dbo.staging_table_22', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_22 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

GO

IF OBJECT_ID('dbo.proc_transform_22', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_22;
GO
CREATE PROCEDURE dbo.proc_transform_22
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_22
    SET payload = LEFT(payload, 1000) + N'|V4-22|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_22;
END
GO
IF OBJECT_ID('dbo.audit_v4_22', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_22 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_22;
GO

CREATE INDEX IDX_staging_22_payload ON dbo.staging_table_22 (id);
GO
EXEC sp_updatestats;
GO

PRINT 'Completed changeset 22';
GO
